import React from 'react'
import { BrowserRouter, Switch, Route, Router } from 'react-router-dom'
import Logueo from '../Vistas/Login'
import Usuario from '../Vistas/Usuarios'

function Rutas()  {
    return(
        <Router>
        <BrowserRouter>
            <Switch>
                <Route path="Login" component={Logueo} />
                <Route path="Usuarios-Clientes" component={Usuario} />            
            </Switch>
        </BrowserRouter>            
        </Router>

    );  
};

export default Rutas;
